import React from "react";
import './ContactField.css'

const ContactField = (props) => {
    const {fieldName, placeholder, inputType} = props;

    if (fieldName !== 'text'){
        return(
            <div className="contactField">
                <h3> {fieldName} </h3>
                <input type={inputType} className={fieldName} placeholder={placeholder}/>
            </div>
        )
    } else {
        return(
            <div className="contactField">
                <h3> {fieldName} </h3>
                <textarea className='textArea' placeholder={placeholder} rows={4}/>
            </div>
        )
    }
}

export default ContactField;
